```python
import itertools

# Define the elements of the group S3 (all permutations of three elements)
S3 = list(itertools.permutations([1, 2, 3]))

# Define the group operation (composition of permutations)
def compose(p1, p2):
    return tuple(p1[p2.index(i)] for i in p1)

# Define the identity element
identity = (1, 2, 3)

# Define the inverse of a permutation
def inverse(p):
    return tuple(p.index(i) + 1 for i in range(1, 4))

# Check if a set of elements is a group
def is_group(S, operation, identity, inverse_func):
    # Check closure
    for p1, p2 in itertools.product(S, repeat=2):
        if operation(p1, p2) not in S:
            return False
    # Check identity
    for p in S:
        if operation(p, identity) != p or operation(identity, p) != p:
